--R15 Tab


local FeR15 = Window:NewTab("Fe R15 Scripts!")
local FeR15Section = FeR15:NewSection("Fe R15 Scripts!")
FeR15Section:NewButton("Human Ball", "Roll Like A Ball!", function()
    print("Clicked")
    local UserInputService = game:GetService("UserInputService")
local RunService = game:GetService("RunService")
local Camera = workspace.CurrentCamera

local SPEED_MULTIPLIER = 30
local JUMP_POWER = 60
local JUMP_GAP = 0.3

local character = game.Players.LocalPlayer.Character

for i,v in ipairs(character:GetDescendants()) do
   if v:IsA("BasePart") then
       v.CanCollide = false
   end
end

local ball = character.HumanoidRootPart
ball.Shape = Enum.PartType.Ball
ball.Size = Vector3.new(5,5,5)
local humanoid = character:WaitForChild("Humanoid")
local params = RaycastParams.new()
params.FilterType = Enum.RaycastFilterType.Blacklist
params.FilterDescendantsInstances = {character}

local tc = RunService.RenderStepped:Connect(function(delta)
   ball.CanCollide = true
   humanoid.PlatformStand = true
if UserInputService:GetFocusedTextBox() then return end
if UserInputService:IsKeyDown("W") then
ball.RotVelocity -= Camera.CFrame.RightVector * delta * SPEED_MULTIPLIER
end
if UserInputService:IsKeyDown("A") then
ball.RotVelocity -= Camera.CFrame.LookVector * delta * SPEED_MULTIPLIER
end
if UserInputService:IsKeyDown("S") then
ball.RotVelocity += Camera.CFrame.RightVector * delta * SPEED_MULTIPLIER
end
if UserInputService:IsKeyDown("D") then
ball.RotVelocity += Camera.CFrame.LookVector * delta * SPEED_MULTIPLIER
end
--ball.RotVelocity = ball.RotVelocity - Vector3.new(0,ball.RotVelocity.Y/50,0)
end)

UserInputService.JumpRequest:Connect(function()
local result = workspace:Raycast(
ball.Position,
Vector3.new(
0,
-((ball.Size.Y/2)+JUMP_GAP),
0
),
params
)
if result then
ball.Velocity = ball.Velocity + Vector3.new(0,JUMP_POWER,0)
end
end)

Camera.CameraSubject = ball
humanoid.Died:Connect(function() tc:Disconnect() end)
end)

FeR15Section:NewButton("Sad Fly", "(Press F to fly)", function()
    print("Clicked")
    
	--[[
    FE SAD
    made by MyWorld#4430
    discord.gg/pYVHtSJmEY
    works on R6, R15, no hats needed
    controls: F to fly
]]

	if "its sad enough to use MyWorld's reanimate" then
		--reanimate by MyWorld#4430 discord.gg/pYVHtSJmEY
		local Vector3_101 = Vector3.new(1, 0, 1)
		local netless_Y = Vector3.new(0, 25.1, 0)
		local function getNetlessVelocity(realPartVelocity) --edit this if you have a better netless method
			local netlessVelocity = realPartVelocity * Vector3_101
			local mag = netlessVelocity.Magnitude
			if mag > 0.1 then
				netlessVelocity *= 100 / mag
			end
			netlessVelocity += netless_Y
			return netlessVelocity
		end
		local simradius = "shp" --simulation radius (net bypass) method
		--"shp" - sethiddenproperty
		--"ssr" - setsimulationradius
		--false - disable
		local noclipAllParts = true --set it to true if you want noclip
		local flingpart = "HumanoidRootPart" --the part that will be used to fling (ctrl + F "fling function")
		local antiragdoll = true --removes hingeConstraints and ballSocketConstraints from your character
		local newanimate = true --disables the animate script and enables after reanimation
		local discharscripts = true --disables all localScripts parented to your character before reanimation
		local R15toR6 = true --tries to convert your character to r6 if its r15
		local hatcollide = true --makes hats cancollide (credit to ShownApe) (works only with reanimate method 0)
		local humState16 = true --enables collisions for limbs before the humanoid dies (using hum:ChangeState)
		local addtools = false --puts all tools from backpack to character and lets you hold them after reanimation
		local hedafterneck = true --disable aligns for head and enable after neck is removed
		local loadtime = game:GetService("Players").RespawnTime + 0.5 --anti respawn delay
		local method = 3 --reanimation method
		--methods:
		--0 - breakJoints (takes [loadtime] seconds to laod)
		--1 - limbs
		--2 - limbs + anti respawn
		--3 - limbs + breakJoints after [loadtime] seconds
		--4 - remove humanoid + breakJoints
		--5 - remove humanoid + limbs
		local alignmode = 2 --AlignPosition mode
		--modes:
		--1 - AlignPosition rigidity enabled true
		--2 - 2 AlignPositions rigidity enabled both true and false
		--3 - AlignPosition rigidity enabled false

		local lp = game:GetService("Players").LocalPlayer
		local rs = game:GetService("RunService")
		local stepped = rs.Stepped
		local heartbeat = rs.Heartbeat
		local renderstepped = rs.RenderStepped
		local sg = game:GetService("StarterGui")
		local ws = game:GetService("Workspace")
		local cf = CFrame.new
		local v3 = Vector3.new
		local v3_0 = v3(0, 0, 0)
		local inf = math.huge

		local c = lp.Character

		if not (c and c.Parent) then
			return
		end

		c.Destroying:Connect(function()
			c = nil
		end)

		local function gp(parent, name, className)
			if typeof(parent) == "Instance" then
				for i, v in pairs(parent:GetChildren()) do
					if (v.Name == name) and v:IsA(className) then
						return v
					end
				end
			end
			return nil
		end

		local function align(Part0, Part1)
			Part0.CustomPhysicalProperties = PhysicalProperties.new(0.0001, 0.0001, 0.0001, 0.0001, 0.0001)

			local att0 = Instance.new("Attachment", Part0)
			att0.Orientation = v3_0
			att0.Position = v3_0
			att0.Name = "att0_" .. Part0.Name
			local att1 = Instance.new("Attachment", Part1)
			att1.Orientation = v3_0
			att1.Position = v3_0
			att1.Name = "att1_" .. Part1.Name

			if (alignmode == 1) or (alignmode == 2) then
				local ape = Instance.new("AlignPosition", att0)
				ape.ApplyAtCenterOfMass = false
				ape.MaxForce = inf
				ape.MaxVelocity = inf
				ape.ReactionForceEnabled = false
				ape.Responsiveness = 200
				ape.Attachment1 = att1
				ape.Attachment0 = att0
				ape.Name = "AlignPositionRtrue"
				ape.RigidityEnabled = true
			end

			if (alignmode == 2) or (alignmode == 3) then
				local apd = Instance.new("AlignPosition", att0)
				apd.ApplyAtCenterOfMass = false
				apd.MaxForce = inf
				apd.MaxVelocity = inf
				apd.ReactionForceEnabled = false
				apd.Responsiveness = 200
				apd.Attachment1 = att1
				apd.Attachment0 = att0
				apd.Name = "AlignPositionRfalse"
